import React from "react";
import PropTypes from "prop-types";
import { withStyles } from "@material-ui/core/styles";

const styles = theme => ({
  container: {
    display: "flex",
    flexWrap: "wrap",
    position: "relative",
    direction: "column"
  },
  dense: {
    marginTop: 19
  },
  menu: {
    width: 200
  }
});

class Faqmenu extends React.Component {
  state = {
    name: "",
    age: "",
    multiline: "Controlled",
    landing: "landing"
  };

  handleChange = name => event => {
    this.setState({
      [name]: event.target.value
    });
  };

  render() {
    const { classes } = this.props;

    return (
      <div className={`${classes.container} ${this.state.landing}`}>
        Here will be a faq drop down menu
      </div>
    );
  }
}

Faqmenu.propTypes = {
  classes: PropTypes.object.isRequired
};

export default withStyles(styles)(Faqmenu);
